import React from "react";
import {FlatList, View} from "react-native";
import {Avatar, Caption, Card, IconButton} from 'react-native-paper';

const ExpenseList = ({expenses}) => {
    return (
        <FlatList
            style={{flex: 1, width: '100%'}}
            data={expenses}
            showsVerticalScrollIndicator={false}
            renderItem={({item}) => (
                <View>
                    <Card
                        mode={"elevated"}>
                        <Card.Title
                            title="Card Title"
                            subtitle="Card Subtitle"
                            left={(props) =>
                                <Avatar.Image {...props}
                                              source={{uri: 'https://ph-files.imgix.net/206c70ae-d2b6-4496-b1da-76746f2ddefb.png?auto=format&auto=compress&codec=mozjpeg&cs=strip&w=80&h=80&fit=crop&bg=0fff&dpr=2'}}/>
                            }
                            right={(props) =>
                                <IconButton size={30}
                                            {...props}
                                            icon="menu-up" onPress={() => {
                                }}/>}
                        />
                        <View
                            style={{flexDirection: 'row', flex: 1}}>
                            <Caption style={{flex: 0.3}}>Free</Caption>
                            <Caption style={{flex: 0.5}}>Caption</Caption>
                        </View>
                    </Card>
                </View>

            )}
            keyExtractor={(item) => item.id}
        />
    );
};

export default ExpenseList;
